import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Heatmap } from 'react-chartjs-2'; // Adjust the import according to the heatmap library you're using

const Home = () => {
  const navigate = useNavigate();
  const [showHeatmap, setShowHeatmap] = useState(false);

  const handleGameClick = () => {
    navigate('/game'); // Navigate to Game page
  };

  const handleRegisterClick = () => {
    navigate('/Register'); // Navigate to Register page
  };

  const handleLoginClick = () => {
    navigate('/Login'); // Navigate to Login page
  };

  const handleHeatmapClick = () => {
    setShowHeatmap((prev) => !prev); // Toggle heatmap visibility
  };

  // Sample data for the heatmap, replace with your actual data
  const heatmapData = {
    labels: ['Label 1', 'Label 2', 'Label 3'], // X-axis labels
    datasets: [
      {
        label: 'Heatmap Data',
        data: [
          { x: 'Label 1', y: 'Label 2', value: 20 },
          { x: 'Label 2', y: 'Label 1', value: 30 },
          // Add more data points as needed
        ],
        backgroundColor: 'rgba(255, 99, 132, 0.5)',
      },
    ],
  };

  return (
    <div>
      <h1>Welcome to the Application</h1>
      <button onClick={handleGameClick}>Go to Game</button>
      <button onClick={handleRegisterClick}>Go to Register</button>
      <button onClick={handleLoginClick}>Go to Login</button>
      <button onClick={handleHeatmapClick}>Show heatmap</button>

      {showHeatmap && (
        <div style={{ marginTop: '20px' }}>
          <h2>Heatmap</h2>
          <Heatmap data={heatmapData} /> {/* Render heatmap here */}
        </div>
      )}
    </div>
  );
};

export default Home;
